    geo_json_5c954154dba64f54bed342f4fc120256.bindTooltip(
    function(layer){
    let div = L.DomUtil.create('div');
    
    let handleObject = feature => {
        if (feature === null) {
            return '';
        } else if (typeof(feature)=='object') {
            return JSON.stringify(feature);
        } else {
            return feature;
        }
    }
    let fields = ["u", "v", "key", "osmid", "tipo_vialidad", "nombre_vialidad", "un_sentido", "reversed", "longitud_m", "vel_max", "num_carriles"];
    let aliases = ["u", "v", "key", "osmid", "tipo_vialidad", "nombre_vialidad", "un_sentido", "reversed", "longitud_m", "vel_max", "num_carriles"];
    let table = '<table>' +
        String(
        fields.map(
        (v,i)=>
        `<tr>
            <th>${aliases[i]}</th>
            
            <td>${handleObject(layer.feature.properties[v])}</td>
        </tr>`).join(''))
    +'</table>';
    div.innerHTML=table;
    
    return div
    }
    ,{
  "sticky": true,
  "className": "foliumtooltip",
